import React from "react";
import "./tablehead.css"

function TableHead() {

    return (
        <table className="table theading">
            {/* <thead>
            <tr> */}
            <th scope="col"><button type="button" class="btn btn-link">Photo:</button></th>
            <th scope="col"><button type="button" class="btn btn-link">Name:</button></th>
            <th scope="col"><button type="button" class="btn btn-link">Phone:</button></th>
            <th scope="col"><button type="button" class="btn btn-link">Email:</button></th>
            <th scope="col"><button type="button" class="btn btn-link">DOB:</button></th>
            {/* </tr>
        </thead> */}
      </table>
    )
}

export default TableHead;
